        return { success: false, message: 'Not Implemented For Web' };
    }
    async setProperty(options) {
        console.log(options);
        return { success: false, message: 'Not Implemented For Web' };
    }
    async registerViewVisit(options) {
        console.log(options);
        return { success: false, message: 'Not Implemented For Web' };
    }
    async evaluate(options) {
        console.log(options);
        return { success: false, message: 'Not Implemented For Web' };
    }
    async evaluateInterceptId(options) {
        console.log(options);
        return { success: false, message: 'Not Implemented For Web' };
    }
}
